import './App.css';
import React, { useState } from "react";
import { AppBar, Box, Container, Tab, Tabs, Typography } from '@material-ui/core';
import HomePageComponent from './components/HomePageComponent';
import OnePost from './components/OnePost.js';
import PropTypes from 'prop-types';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
          children
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}


export default function App(){

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue)
  }

  return (
    <Container>
        <Tabs
          value={value}
          indicatorColor="primary"
          textColor="primary"
          onChange={handleChange}
          centered
          >
              <Tab label="Home" {...a11yProps(0)}/>
              <Tab label="SinglePage" {...a11yProps(1)} />
        </Tabs>
    <TabPanel value={value} children={[HomePageComponent]} index={0}>
      </TabPanel>
      <TabPanel value={value} children={OnePost} index={1}>
      </TabPanel>
    </Container>
  );

}
